import React from "react";

const Categorypage = ()=>{
    return (
        <div style={{border:"20px",}}>
            <img src="Homepage.jpg" alt="Homepage" height="400px" width="400px" />
            <a href="seeds.jpg">Seeds</a><br/>
            <a href="fruits.jpg">fruits</a>

        </div>
    )
}
export default Categorypage;
